import React, { useState } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import { Container } from "react-bootstrap";
import styled from "styled-components";
import { useHistory } from "react-router-dom";

import { Formik } from 'formik';

const LoginStyle = styled.div`
@media all and (min-width: 480px) {
    .Login {
      padding: 60px 0;
    }

    .Login form {
      margin: 0 auto;
      max-width: 420px;
    }
  }
`;


type FormData = {
    quizId: string;
    quizName: string;
  }

  type FormErrors = {
    id?: string;
    name?: string;
  }

export function Login() {
    const history = useHistory();
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [state, setState] = useState<FormData>({});
    const [errors, setErrors] = useState<FormErrors>({});

    function validateForm() {
      return email.length > 0 && password.length > 0;
    }

    function handleSubmit(event : React.FormEvent) {
      event.preventDefault();
    }

    return (
        <LoginStyle>
        <Container className="justify-content-center">
            <div className="Login text-left" >
                <Form onSubmit={handleSubmit} >
                <h1>Log in</h1>
                <p>
                    Please enter your email and password to log in to your Pibu care account.
                </p>  <hr></hr>
                <Form.Group className="lg" controlId="email">
                    <Form.Label >Email</Form.Label>
                    <Form.Control
                    autoFocus
                    type="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    />
                </Form.Group>
                <Form.Group className="lg" controlId="password">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                    type="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    />
                </Form.Group>
                <Button block size="lg" type="submit" disabled={!validateForm()}>
                    Login
                </Button>
                <Button block size="lg" className="btn-secondary" type="cancel" onClick={ () => history.goBack()}>
                    Cancel
                </Button>
                </Form>
            </div>
        </Container>
        </LoginStyle>
    );
  }
